 The Arsenio Hall Show is an American syndicated late-night talk show created by and starring comedian Arsenio Hall. Both series were produced by Hall's production company, Arsenio Hall Communications. The second series was shot at Sunset Bronson Studios in Hollywood and was produced by Tribune Broadcasting, Octagon Entertainment, and Eye Productions and was distributed by CBS Television Distribution. Mullen is the primary host and producer of the show, with Halkias as co-host. Friedland, who appears least frequently of the three, first appeared in the show's second episode and often serves as the butt of Mullen and Halkias' jokes and insults. The content is almost entirely unplanned, with the hosts' aimless conversation giving way to improvised comedic characters and sketches. Mullen does many celebrity impressions, including Donald Trump, Barack Obama, Michael Douglas, Dennis Hopper, E. Jean Carroll, Dwayne Johnson, Joe Biden, Andrew Cuomo, Patrick Warburton, Rip Torn, Gene Hackman, Jon Hamm, Norm MacDonald, Joe List, Mark Normand, Ice-T and Homer Simpson, with many episodes of the show featuring him trying to perfect a new impression on-air. (2001-2009) ; Hotlines (2003-2004) ; The Joe Schmo Show (2003-2013) ; MXC (2003-2007) ; Ride with Funkmaster Flex (2003-2004) ; Spike Video Game Awards (2003-2013) ; The John Henson Project (2004) ; 10 Things Every Guy Should Experience (2004) ; The Club (2004-2005) ; 

 Drawn Together is an American adult animated television sitcom created by Dave Jeser and Matt Silverstein and premiered on Comedy Central on October 27, 2004. The series is a parody of The Real World and follows the misadventures of the housemates in the fictional show of the same name and uses a sitcom format with a reality TV show setting. Comedy Central advertised it as the first animated reality TV series, and in some episodes, the characters participate in challenges that are similar to reality TV challenges, although the premise is largely dropped in later episodes. Piscopo had an occasional spot on the Weekend Update segment as a bombastic sports commentator who would pose a series of questions and usually follow them up with a loud, “Who cares?” Piscopo and Robin Duke also played Doug and Wendy Whiner. The series follows the life of comedian and radio show host Rickey Smiley as he juggles between his career, fatherhood and personal life, with the two main settings being Birmingham, Alabama (his hometown) and Atlanta, Georgia (where he hosts his syndicated radio show). "[The show] showcases the ‘real’ Rickey," said D’Angela Proctor, the network's vice president.
